import './SearchResultItem.css';
import Iteminfo from './ItemInfo';
import DummyImage from './img/book_1.jpg'

class SearchResultItem extends Component{

	render (){
		const bookInfo = this.props.Data;
		const list = bookInfo.map(
			info => (<Iteminfo imgUrl={DummyImage} 
			bookName={list.id} bookAuthor={list.author}/>));
		// console.log(bookInfo);
		// console.log(bookInfo[0]);
		// console.log(bookInfo.length);
		return (
			<Fragment>
				<div class="item-container">

				<Iteminfo imgUrl={DummyImage} bookName="asdf" bookAuthor="이창민" bookState="asdf" />
					<Iteminfo imgUrl={DummyImage} bookName="Test" bookAuthor={bookInfo[0].author} bookState="return" />
					<Iteminfo imgUrl={DummyImage} bookName="Test" bookAuthor="이창민" bookState="no_borrow" />
					<Iteminfo imgUrl={DummyImage} bookName="Test" bookAuthor="이창민" bookState="borrow" />
					<Iteminfo imgUrl={DummyImage} bookName="Test" bookAuthor="이창민" bookState="borrow" />
					<Iteminfo imgUrl={DummyImage} bookName="Test" bookAuthor="이창민" bookState="borrow" />
				</div>
			</Fragment>

		);
	}
}

export default SearchResultItem;
